import React, { Component } from 'react'
import { Card} from 'react-bootstrap';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faUsers, faStar, faShareAlt, faExclamation, } from "@fortawesome/free-solid-svg-icons";
export default class MyCard extends Component {
  // constructor(props) {
  //   super(props);
  // }
  // openNewPage = () => {
  //   window.open(this.props.htmlUrl);
  // };
  render() {
    const {
      listNum,
      avatar,
      name,
      starsCount,
      forksCount,
      openIssuesCount,
    } = this.props;
    return (
      <Card style={{width:'18rem',height:350,marginBottom:10,backgroundColor:'skyblue'}}>
       <div style={{textAlign:'center'}}>#{listNum}</div>
        <Card.Img style={{width:'90%',margin:0}} variant="top" src={avatar} />
        <Card.Body>
          <Card.Title style={{textAlign:'center'}}>{name}</Card.Title>
          <Card.Text>
            <ul>
              <li style={{listStyle:'none'}}><FontAwesomeIcon style={{ color: '#ffbf74', width: 20 }} icon={faUsers} />{name}</li>
              <li style={{listStyle:'none'}}><FontAwesomeIcon style={{ color: '#ffd700', width: 20 }} icon={faStar} />{starsCount} stars</li>
              <li style={{listStyle:'none'}}><FontAwesomeIcon style={{ color: '#82c3f5', width: 20 }} icon={faShareAlt} />{forksCount} forks</li>
              <li style={{listStyle:'none'}}><FontAwesomeIcon style={{ color: '#f18a92', width: 20 }} icon={faExclamation} />{openIssuesCount} open issues</li>
            </ul>
          </Card.Text>
        </Card.Body>
      </Card>

      // <div className="" onClick={this.openNewPage}>
      //   <span className="">#{listNum}</span>
      //   <img src={avatar} alt="" className="" />
      //   <p className="">{name}</p>
      //   <div style={{ margin: '0 auto' }}>
      //     <div style={{ marginBottom: "5px" }}>
      //       <FontAwesomeIcon style={{ color: '#ffbf74', width: 20 }} icon={faUsers} />
      //       <span style={{ fontWeight: "bold" }}> {name}</span>
      //     </div>
      //     <div style={{ marginBottom: "5px" }}>
      //       <FontAwesomeIcon style={{ color: '#ffd700', width: 20 }} icon={faStar} />
      //       <span>{starsCount} stars</span>
      //     </div>
      //     <div style={{ marginBottom: "5px" }}>
      //       <FontAwesomeIcon style={{ color: '#82c3f5', width: 20 }} icon={faShareAlt} />
      //       <span>{forksCount} forks</span>
      //     </div>
      //     <div>
      //       <FontAwesomeIcon style={{ color: '#f18a92', width: 20 }} icon={faExclamation} />
      //       <span>{openIssuesCount} open issues</span>
      //     </div>
      //   </div>
      // </div>
    );
  }
}
